	root: {
		minHeight: '100vh'
	},
});

export default function CallToAction() {
	const classes = useStyles();

	return (
		<div className={classes.root}>
			<ImageCard info={places[0]} />
			<ImageCard info={places[1]} />
		</div>
	);
}
